import { useState } from 'react';
import HeadSelector from './FieldSelection';
import './Table.css';

function Table({data}) {
    const [newData, setNewData] = useState([]);

    const renderTableData = (object) => {
        return object.data.map((data,index) => {
            return  <td key={index}>{data}</td>;
        });
    }
    const handleClick= (e) => {
        console.log(e.target,data);
    }

    return (
        <>
            <table id="Info">
                <thead>
                    <tr>
                        <th><input type="checkbox" onClick={(e) => handleClick(e)}/></th>
                        <th><HeadSelector/></th>
                        <th><HeadSelector/></th>
                        <th><HeadSelector/></th>
                        <th><HeadSelector/></th>
                    </tr>
                </thead>
                <tbody>
                    { data &&   
                        data.map((value,index) => {
                            return <tr key={index}>
                                    <td><input type="checkbox" onClick={(e) => handleClick(e)}/></td>
                                    {renderTableData(value)}
                                </tr>;
                        })
                    }
                </tbody>
            </table>
        </>
    )
}
export default Table;
